import React from 'react';
import { useState } from 'react';
import { Form, Button, Container } from 'react-bootstrap';



export const Test = () => {


    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [message, setMessage] = useState('');

    const [redirect, setRedirect] = useState(false);



const submitForm = async (event) => {
        event.preventDefault();

}

    return (
        <Container className="mt-5">
        <Form className="w-50" onSubmit={submitForm}>
            <h1>Contact Me!</h1>
            <input type="firstName" className="form-control mb-3" placeholder="firstName" required 
                onChange={event => setFirstName(event.target.value.trim())}
            />  
            <input type="lastName" className="form-control mb-3" placeholder="lastName" required 
                onChange={event => setLastName(event.target.value.trim())}
            />                         
            <input type="email" className="form-control mb-3" placeholder="Email" required 
                onChange={event => setEmail(event.target.value.trim())}
            />
            <input type="message" className="form-control mb-3" placeholder="Message" required 
                onChange={event => setMessage(event.target.value.trim())}
            />
            <Button className="btn btn-outline-dark text-white" type="submit">Contact Me</Button>
        </Form>
        </Container>
    );

    }
